function useData(res){
  var labels = res.labels
  var rawData = res.data

  var data = rawData.map(l=>l.map((e,i)=>{
    return {x: i, y:e, title: 'THE title'}
  }))

  var stack = d3.layout.stack()
    .order('inside-out')
    .offset("wiggle")
      layer = stack(data)

  var width = 1300,
      height = 500;

  var x = d3.scale.linear()
      .domain([0, d3.max(data[0], o=>o.x)])
      .range([0, width]);

  var y = d3.scale.linear()
      .domain([0, d3.max(layer, function(layer) { return d3.max(layer, function(d) { return d.y0 + d.y; }); })])
      .range([height, 0]);

   var color = d3.scale.category20();

  var area = d3.svg.area()
      .interpolate('basis')
      .x(function(d) { return x(d.x); })
      .y0(function(d) { return y(d.y0); })
      .y1(function(d) { return y(d.y0 + d.y); });

  var svg = d3.select("body").append("svg")
      .attr("width", width)
      .attr("height", height);

  // Define the div for the tooltip
  var div = d3.select("body").append("div")
      .attr("class", "tooltip")
      .style("opacity", 0);

  svg.selectAll("path")
      .data(layer)
      .enter()
      .append("path")
      .attr("d", area)
      .style("fill", function() { return color(Math.random()); })
      .on("mouseover", function(d,i) {
        div.transition()
            .duration(200)
            .style("opacity", .6);
        console.log(d)
        console.log(i)
        div.html(labels[i])
            .style("left", (d3.event.pageX + 5) + "px")
            .style("top", (d3.event.pageY - 23) + "px");
        })
      .on("mouseout", function(d) {
        div.transition()
            .duration(500)
            .style("opacity", 0);
      })
  svg.selectAll("path")
      .append('text')
      .text('WWWWWWWWWWWWWWWWWWWWWWWW');
}

$.getJSON("http://localhost:3000/data", useData)
